import React from 'react';
import github from '../images/ic-navbar-github.svg';
import linkedin from '../images/ic-navbar-linkedin.svg';

function Margin() {
  return (
    <div className="margin">
      <div className="left">
      <div className="icons">
        <a href="https://github.com/myriankatto" ><img src={github} alt="github" /></a>
        <img src={linkedin} alt="linkedin" />
        </div>
      </div>
      <div className="right">
        <span>Contacts</span>
      </div>
      <div className="top">
        <h1>Myrian Katto</h1>
      </div>
    </div>
  );
}

export default Margin;
